import jsPDF from 'jspdf'
(function (jsPDFAPI) {
var font = "";
var callAddFont = function () {
this.addFileToVFS("PlayfairDisplay-Regular-normal.ttf", font);
this.addFont("PlayfairDisplay-Regular-normal.ttf", "PlayfairDisplay-Regular", "normal");
};
jsPDFAPI.events.push(['addFonts', callAddFont])
 })(jsPDF.API);